timeApp.shake = {
	settings: {
		test: null,
		back: null,
		mvgAvgx: null,
		mvgAvgy: null,
		diffArr: null,
		current: 0,
		counter: 0,
		min: -800,
		max: 800,
		col: [
			[
				[144, 0, 255],
				[255, 0, 0]
			],
			[
				[13, 255, 0],
				[255, 145, 0]
			]
		],
		socket: null,
		subuser: null
	},
	init: function(Socket, Userset) {
		console.log("Shake JS Init");
		timeApp.shake.settings.socket = Socket;
		timeApp.shake.settings.test = document.getElementById("test");
		timeApp.shake.settings.back = document.getElementById("shake");
		timeApp.shake.settings.diffArr = [0, 0];
		Userset.getUserSub();
		timeApp.shake.settings.subuser = Userset.subuser;
		console.log(timeApp.shake.settings.subuser)
		timeApp.modal.alert("<h2>Shake your phone, becasue it's all about the bass.</h2><h3>Shake</h3><img src='/public/content/shake.png'>")

		window.addEventListener("devicemotion", timeApp.shake.motionEvent, true);
	},
	motionEvent: function(event) {
		var x = event.accelerationIncludingGravity.x;

		timeApp.shake.settings.mvgAvgx = (x * 0.4) + (timeApp.shake.settings.mvgAvgx * (1 - 0.4));

		timeApp.shake.settings.diffArr.shift();
		timeApp.shake.settings.diffArr[timeApp.shake.settings.diffArr.length] = timeApp.shake.settings.current;

		timeApp.shake.settings.current = (Math.floor(timeApp.shake.settings.mvgAvgx.toFixed(2) * 1000));

		if (timeApp.shake.settings.current < timeApp.shake.settings.min && timeApp.shake.settings.current < 8000) {
			timeApp.shake.settings.min = timeApp.shake.settings.current;
		} else if (timeApp.shake.settings.current > timeApp.shake.settings.max && timeApp.shake.settings.current < 8000) {
			timeApp.shake.settings.max = timeApp.shake.settings.current;
		}

		if ((timeApp.shake.diff(timeApp.shake.settings.diffArr[0], timeApp.shake.settings.diffArr[1])) > 100) {
			timeApp.shake.settings.back.style.backgroundColor = timeApp.shake.mapColour(timeApp.shake.settings.current, timeApp.shake.settings.min, timeApp.shake.settings.max, timeApp.shake.settings.col[timeApp.shake.settings.subuser][0], timeApp.shake.settings.col[timeApp.shake.settings.subuser][1]);
			timeApp.shake.settings.test.style.color = timeApp.shake.mapColour(timeApp.shake.settings.current, timeApp.shake.settings.min, timeApp.shake.settings.max, timeApp.shake.settings.col[timeApp.shake.settings.subuser][1], timeApp.shake.settings.col[timeApp.shake.settings.subuser][0]);
		}

		//TODO-BA: Add colour select by ID group

		//Touch Designer Data
		if (timeApp.shake.settings.current > 5000) {
			if (timeApp.shake.settings.current > timeApp.shake.settings.max || timeApp.shake.settings.current < timeApp.shake.settings.min) {
				timeApp.shake.settings.counter++
				timeApp.shake.settings.socket.emit("sha", timeApp.shake.settings.counter);
				//timeApp.shake.settings.test.innerHTML = "counter: " + timeApp.shake.settings.counter;
				timeApp.shake.settings.test.style.top = "-" + timeApp.shake.settings.counter * 16 + "px";
				//console.log(timeApp.shake.settings.counter);
			}
		}
	},
	onexit: function() {
		window.removeEventListener("devicemotion", timeApp.shake.motionEvent, true);
	},
	diff: function(a, b) {
		return Math.abs(a - b);
	},
	mapColour: function(cur, min, max, c1, c2) {
		var percent = (cur - min) / (max - min);
		return "rgb(" + timeApp.shake.map(percent, c1, c2, 0) + "," + timeApp.shake.map(percent, c1, c2, 1) + "," + timeApp.shake.map(percent, c1, c2, 2) + ")"
	},
	map: function(percent, c1, c2, c) {
		return Math.floor(percent * (c2[c] - c1[c]) + c1[c])
	}
}
timeApp.diagnostics = {
	settings: {
		Socket: null,
		diagdata: null,
		tiltEvent: null,
		data: [],
		lastEvent: 0,
		width: 1800,
		height: 700,
		yscale: null,
		xscale: null,
		linex: null,
		liney: null,
		linez: null,
		pathx: null,
		pathy: null,
		pathz: null
	},
	init: function(Socket) {
		console.log("diagnostics...")
		if (!Socket) {
			console.log("you need to pass socket into the diagnostics init");
			return false;
		}
		timeApp.diagnostics.settings.Socket = Socket;



		//used http://bost.ocks.org/mike/path/ for reference
		//Create the data array... change 60 to the number of points
		for (var a = 0; a < 120; ++a) {
			timeApp.diagnostics.settings.data.push({
				"x": 0,
				"y": 0,
				"z": 0
			})
		}

		timeApp.diagnostics.settings.diagdata = Socket.on("diagdata", timeApp.diagnostics.datain);
		timeApp.diagnostics.settings.xscale = d3.scale.linear()
			.domain([0, timeApp.diagnostics.settings.data.length - 1])
			.range([0, timeApp.diagnostics.settings.width]);
		timeApp.diagnostics.settings.yscale = d3.scale.linear()
			.domain([-30, 30])
			.range([timeApp.diagnostics.settings.height, 0]);


		// LINES ,these determin which data set we use... x,y,z
		timeApp.diagnostics.settings.linex = d3.svg.line()
			.x(function(d, i) {
				return timeApp.diagnostics.settings.xscale(i);
			})
			.y(function(d, i) {
				return timeApp.diagnostics.settings.yscale(d.x);
			})
		timeApp.diagnostics.settings.liney = d3.svg.line()
			.x(function(d, i) {
				return timeApp.diagnostics.settings.xscale(i);
			})
			.y(function(d, i) {
				return timeApp.diagnostics.settings.yscale(d.y);
			})
		timeApp.diagnostics.settings.linez = d3.svg.line()
			.x(function(d, i) {
				return timeApp.diagnostics.settings.xscale(i);
			})
			.y(function(d, i) {
				return timeApp.diagnostics.settings.yscale(d.z);
			})


		//set up the document
		var margins = 100;
		var xCol = "#f00";
		var yCol = "#0f0";
		var zCol = "#00f";
		var svg = d3.select("#datalocation").append("svg")
			.attr("width", timeApp.diagnostics.settings.width + margins)
			.attr("height", timeApp.diagnostics.settings.height + margins)


		// GRID LINES
		var yAxis = d3.svg.axis()
			.scale(timeApp.diagnostics.settings.yscale)
			.orient("left")
			.ticks(20);
		var xAxis = d3.svg.axis()
			.scale(timeApp.diagnostics.settings.xscale)
			.orient("top");
		svg.append("g")
			.attr("transform", "translate(" + margins + "," + margins + ")")
			.call(yAxis);
		svg.append("g")
			.attr("transform", "translate(" + margins + "," + margins + ")")
			.call(xAxis);

		// add the parent element of all the lines
		svg = svg.append("g")
			.attr("transform", "translate(" + margins + "," + margins + ")");

		// actually add the lines now... and their colours are described in here...
		timeApp.diagnostics.settings.pathx = svg.append("g")
			.attr("clip-path", "url(#clip)")
			.append("path")
			.datum(timeApp.diagnostics.settings.data)
			.attr("class", "line")
			.attr("d", timeApp.diagnostics.settings.linex)
			.attr("fill", "none")
			.attr("stroke", xCol);



		timeApp.diagnostics.settings.pathy = svg.append("g")
			.attr("clip-path", "url(#clip)")
			.append("path")
			.datum(timeApp.diagnostics.settings.data)
			.attr("class", "line")
			.attr("d", timeApp.diagnostics.settings.liney)
			.attr("fill", "none")
			.attr("stroke", yCol);

		timeApp.diagnostics.settings.pathz = svg.append("g")
			.attr("clip-path", "url(#clip)")
			.append("path")
			.datum(timeApp.diagnostics.settings.data)
			.attr("class", "line")
			.attr("d", timeApp.diagnostics.settings.linez)
			.attr("fill", "none")
			.attr("stroke", zCol);
	},
	datain: function(msg) {
		if (typeof timeApp.diagnostics.settings.data[0] != typeof msg) {
			console.log("the data type is bad...")
		} else {

			//add your filter here
			var filter = msg;


			//append the new data
			timeApp.diagnostics.settings.data.push(filter);

			//update the graph...
			timeApp.diagnostics.settings.pathx
				.attr("d", timeApp.diagnostics.settings.linex)
			timeApp.diagnostics.settings.pathy
				.attr("d", timeApp.diagnostics.settings.liney)
			timeApp.diagnostics.settings.pathz
				.attr("d", timeApp.diagnostics.settings.linez)

			//remove the old
			timeApp.diagnostics.settings.data.shift();

		}
	},
	onexit: function(Socket) {
		window.removeEventListener("devicemotion", timeApp.diagnostics.settings.tiltEvent, true);
		Socket.onunbind("diagdata");
	},



	createDiagnosticButton: function(Socket) {
		var button = document.createElement("button");
		button.innerHTML = "send data";
		$("#main_container")[0].appendChild(button);
		var senddata = function(event) {
			console.log(event.timeStamp)
			Socket.emit("tap","1");
			Socket.emit("diagdata", event.timeStamp);
		}
		$(button).click(senddata);
	},


	addTiltEventListener: function(Socket) {
		timeApp.diagnostics.settings.Socket = Socket;
		timeApp.diagnostics.settings.tiltEvent = function(event) {
			if (Date.now() - timeApp.diagnostics.settings.lastEvent > 10) {
				var x = (event.accelerationIncludingGravity.x) ? event.accelerationIncludingGravity.x : 0,
					y = (event.accelerationIncludingGravity.y) ? event.accelerationIncludingGravity.y : 0,
					z = (event.accelerationIncludingGravity.z) ? event.accelerationIncludingGravity.z : 0;
				console.log({
					"x": x,
					"y": y,
					"z": z,
				});
				timeApp.diagnostics.settings.Socket.emit("diagdata", {
					"x": x,
					"y": y,
					"z": z
				});
				timeApp.diagnostics.settings.lastEvent = Date.now();
			}
		}
		window.addEventListener("devicemotion", timeApp.diagnostics.settings.tiltEvent, true);
	}

}
